import React, { Component } from 'react'
import MainCard from './partbody/MainCard'
import TopArticle from './partbody/TopArticle';
import Account from './Member/Account';
import Sugestion from './partbody/Suggestion';
import AddMedia from './partbody/AddMedia';

import CreateArticle from './Page/CreateArticle'
import CreateEvent from './Page/CreateEvent'
import Event from './Page/Event'

import { Container, Row, Col} from 'reactstrap';
import Member from './Member/Member';





export default class AppBody extends Component {

  render() {
    return (
      <div style={{backgroundColor:'#ececec'}} > 

				<Container >
        <Row>
        <Col xs={12} md={8}
           style={{}} 
          >	<MainCard />

          </Col>
          <Col xs={6} md={4}
          style={{}}   
          > <Account/>
		<TopArticle/>
	<Sugestion/>
					</Col>

        </Row>

      </Container>
<AddMedia />
      </div>
    )
  }
}
